import React from "react";

const styles = {
  pictographContainer: {
    flex: 1,
    padding: "10px",
    border: "1px solid #ddd",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    fontSize: "1.2rem",
    fontWeight: "bold",
    aspectRatio: "1 / 1",
  },
};

const GraphEditorPictographContainer = () => {
  return (
    <div style={styles.pictographContainer}>
      <p>Pictograph Placeholder</p>
    </div>
  );
};

export default GraphEditorPictographContainer;
